const SearchBar = (props) => {
	return (
		<main>
			<form onSubmit={props.handleSubmit}>
				{props.isLoading && <div>Loading......</div>}
				<input type="text" name="query" />
				<input type="submit" />
			</form>
			<section>
				<h2>Showing results for "jurong"</h2> <p>Available lots: </p>
				<p>Total lots:</p>
				<p>Free parking:</p>
			</section>
		</main>
	);
};

export default SearchBar;
